import "../styles.css";

const FooterComponent = () => {
  return (
    <div id="footer">
      <div id="footerTitle">sitemap</div>
      <div id="links">
        <a href="#">login</a>
        <a href="#">about</a>
        <a href="#">courses</a>
        <a href="#">careers</a>
        <a href="#">contact-us</a>
      </div>
    </div>
  );
};

export default FooterComponent;
